import './App.css';
import './index.css';
import fairyHalf from './img/fairy_half.png';
import clock from './img/clock.png';
import logo from './img/logo.png';

function App() {
  const mapStyle = {
    width : "700px",
    height : "350px"
  };

  return (
    <div id="wrap">
        <div id="h-logo">
            <a href="index.html"><img id="logo" src={logo} alt="로고" width="220px"/></a>
        </div>
    </div>
  );
}

export default App;
